import React from 'react'

export default function DogInfo({dog}) {

  return(
    <>
      <img src={dog.image} alt={dog.name}/>
      <h2>{dog.name}</h2>
      <button>{dog && dog.isGoodDog ? "Good Dog!" : "Bad Dog!"}</button>
    </>

  )

}
